import {GET_REGISTRATION} from "../action-types/Registration-action-types"

const initalState = [];

const Users = (state=initalState,action) => {
	switch (action.type) {
		// case "LOAD_USER":
		// 	console.log(action.payload)
		// 	return [...state, ...action.payload]
		// need to create a seperate on if wish to use this
		case GET_REGISTRATION:
			return {...state,...action.payload}

		default:
			return state;
	}
}
export default Users;
